import React, { Component, Fragment } from "react";
import "./Stylesheets/style.scss";
import ShowPanel from './ShowPanel';
import Sidebar from './Sidebar';
import Topbar from './Topbar';


export default class App extends Component {
  render() {
    return <Fragment>
      <ShowPanel />
      <Sidebar />
      <Topbar />
    </Fragment>;
  }
}
